function ChildStateComponent({ counter, setCounter }) {
    return (
      <div>
        <h3>Counter {counter}</h3>
        <button onClick={() => setCounter(counter + 1)}>
          Increment</button>
        <button onClick={() => setCounter(counter - 1)}>
          Decrement</button>
      </div>
    );
  }
  export default ChildStateComponent;
